window.bookSummaryJSON = "<p>All help is gone. Gaea is vicious and brutal. All we can do is fend for ourselves.</p> <p>There I was, thinking that things were finally going to get a little bit better. I had no idea how, but the System was on humanity's side, giving us hints and even unlocking a new all-powerful summon for me.</p> <p>Nope. That System is gone now, replaced by a new one that's cold and unfeeling. And to make matters worse, the darkling are stronger than ever before.</p> <p>The three princes—Nieven, Tigris, and a new monster named Mirugo—are forcing their race to march up the tower at sword point, sacrificing thousands of their own to claim new powers and rewards.</p> <p>Humanity has no choice but to follow. To survive the next event, I need to climb the Tower of Oblivion as quickly as I can and get my hands on the same kind of power as the darkling.</p> <p>My name is Devin Cain. Join me and my friends—human, dwergar, and now, even a lone darkling—as we do everything in our power to survive.</p> <p>The apocalypse has come, and our only choice is to climb or die.</p>"; 
